import React from 'react';
import { Modal, ModalBody } from 'reactstrap'; 
import product_list from '../assets/data/products-list'
const Popup = ({ isOpen, toggle, productId }) => {
  // Xử lý hàm đặt hàng
  const product = product_list.find() 
  return (
    <Modal isOpen={isOpen} toggle={toggle}>
      <ModalBody>
        <h5>Bạn có muốn đặt hàng sản phẩm này?</h5>
        <button onClick={toggle}>Đặt hàng</button>
        <button onClick={toggle}>Hủy</button>
      </ModalBody>
    </Modal>
  );
};

export default Popup;
